import React from 'react';
import { ReactComponent as Logo} from '../../resources/images/jplogo.svg';


const menu_bar = () => {
    return (
        <nav>
            <ul>
                <li><Logo Fill="red" /></li>
                <li>about</li>
                <li>portfolio</li>
                <li>blog</li>
                <li>HOME</li>
            </ul>
        </nav>
    );
};

export default menu_bar;
